static const int16_t rf_tree_offsets[RF_NUM_TREES] = {0, 39, 44, 65, 70, 139, 178, 183, 196, 201, 232, 269, 292, 317, 338, 431, 436, 473, 478, 483, 488, 499, 518, 527, 574, 603, 608, 655, 660, 757, 762, 771, 792, 829, 842, 847, 878, 887, 926, 943, 960, 971, 976, 1001, 1014, 1027, 1060, 1071, 1076, 1091, 1114, 1119, 1132, 1205, 1262, 1283, 1316, 1329, 1348, 1377, 1398, 1403, 1432, 1505, 1510, 1537, 1542, 1561, 1654, 1681, 1696, 1709, 1714, 1733, 1738, 1777, 1826, 1831, 1864, 1869, 1874, 1889, 1916, 1921, 1974, 1979, 2010, 2035, 2040, 2059, 2076, 2095, 2142, 2203, 2230, 2235, 2260, 2303, 2312, 2351};

static const int16_t rf_tree_n_nodes[RF_NUM_TREES] = {39, 5, 21, 5, 69, 39, 5, 13, 5, 31, 37, 23, 25, 21, 93, 5, 37, 5, 5, 5, 11, 19, 9, 47, 29, 5, 47, 5, 97, 5, 9, 21, 37, 13, 5, 31, 9, 39, 17, 17, 11, 5, 25, 13, 13, 33, 11, 5, 15, 23, 5, 13, 73, 57, 21, 33, 13, 19, 29, 21, 5, 29, 73, 5, 27, 5, 19, 93, 27, 15, 13, 5, 19, 5, 39, 49, 5, 33, 5, 5, 15, 27, 5, 53, 5, 31, 25, 5, 19, 17, 19, 47, 61, 27, 5, 25, 43, 9, 39, 9};


// Predict for a single tree
static inline int rf_predict_tree(int tree_index, const float *features) {
    int node = rf_tree_offsets[tree_index];
    int end = node + rf_tree_n_nodes[tree_index];

    while (1) {
        int16_t feature = rf_node_feature[node];
        int16_t left = rf_node_left[node];
        int16_t right = rf_node_right[node];

        // Leaf node: both children are -1
        if (left == -1 && right == -1) {
            return rf_node_class[node];
        }

        float threshold = rf_node_threshold[node];
        float value = features[feature];

        node = (value <= threshold) ? left : right;

        // Safety check (should not happen if tree is well-formed)
        if (node < 0 || node >= end) {
            return rf_node_class[node];
        }
    }
}

// Predict by majority vote over all trees
static inline int rf_predict(const float *features) {
    int votes[RF_NUM_CLASSES];
    for (int c = 0; c < RF_NUM_CLASSES; ++c) {
        votes[c] = 0;
    }

    for (int t = 0; t < RF_NUM_TREES; ++t) {
        int pred = rf_predict_tree(t, features);
        if (pred >= 0 && pred < RF_NUM_CLASSES) {
            votes[pred]++;
        }
    }

    int best_class = 0;
    int best_votes = votes[0];
    for (int c = 1; c < RF_NUM_CLASSES; ++c) {
        if (votes[c] > best_votes) {
            best_votes = votes[c];
            best_class = c;
        }
    }
    return best_class;
}

